In simple linear regression, we aim to get a a line that can represent the data we have as best as possible. If you had the following lines, which one would you choose? and why? # a pandas dataframe with 2 columns: x and y import pandas as pd import numpy as np import matplotlib.pyplot as plt x = [1, 1.5, 2.5, 3, 4] y = [1, 2.3, 2.1, 3, 2.9] df = pd.DataFrame({'x': x, 'y': y}) # plot the data # Scatter plot of the dots f, ax = plt.subplots(figsize=(5,5)) ax.scatter(df['x'], df['y'], s=60) # Plot an arbitrary line x = np.linspace(0, 4, 11) y_bad = 2.2+ -x y_good = x + 0.5 y_better = 0.55789474*x + 0.92105263 ax.plot(x,y_bad, label=f'bad: y=2.2 - x', color='red') ax.plot(x,y_good, label=f'good: y=0.5 + x', color='orange') ax.plot(x,y_better, label=f'better: y= 0.92 + 0.558 x', color='green') ax.legend(loc='best') ax.grid(alpha=0.2) plt.show() Output: We can't choose a line based on how it looks, we need to use a performance measure to evaluate the model. We can't use arbitrary points to draw a line using the slope: y=y2−y1x2−x1x+by =  rac{y_{2} - y_{1}}{x_{2} - x_{1}}x + by=x2​−x1​y2​−y1​​x+b One of the common performance measures is mean of the squared errors or the squared residuals MSEMSEMSE. How? we take the difference between the actual value and the predicted value, and we square it. and we do that for every data point, and we get the mean of all those values. MSE=1m∑i=1m(yi−yi^)2MSE =  rac{1}{m}\sum_{i=1}^{m}(y_{i} - \hat{y_{i}})^{2}MSE=m1​∑i=1m​(yi​−yi​^​)2 We want to find the y^\hat{y}y^​ that gets us the lowers MSEMSEMSE. Here's an explanation of calculating the MSEMSEMSE for a simple linear regression model. (we won't be doing this manually) import pandas as pd df = pd.DataFrame([[1, 1], [1.5, 2.3], [2.5, 2.1], [3, 3], [4, 2.9]], columns=['x', 'y']) df x y 0 1.0 1.0 1 1.5 2.3 2 2.5 2.1 3 3.0 3.0 4 4.0 2.9 we'll just start with a random line, any line, # plot the data import matplotlib.pyplot as plt # Scatter plot of the dots f, ax = plt.subplots(figsize=(5,5)) ax.scatter(df['x'], df['y']) # Plot an arbitrary line x = np.linspace(0, 4, 11) y = 0*x + 2.2 ax.plot(x,y, label=f'y=2.25') ax.grid(alpha=0.2) plt.show() Output: and then calculate the distance between the line and the data points. # plot the data import matplotlib.pyplot as plt # Scatter plot of the dots f, ax = plt.subplots(figsize=(5,5)) ax.scatter(df['x'], df['y']) # Plot an arbitrary line x = np.linspace(0, 4, 11) y = 0*x + 2.2 ax.plot(x,y, label=f'y=2.25') # Residuals ax.plot([1,1],[1, 2.2], color='red', linestyle='dotted', alpha=0.5) ax.text(1.1, 1.5, '1.2') ax.plot([1.5,1.5],[2.3, 2.2], color='red', linestyle='dotted', alpha=0.5) ax.text(1.6, 2.25, '-0.1') ax.plot([2.5,2.5],[2.1, 2.2], color='red', linestyle='dotted', alpha=0.5) ax.text(2.6, 2.12, '0.1') ax.plot([3,3],[3, 2.2], color='red', linestyle='dotted', alpha=0.5) ax.text(3.1, 2.4, '-0.8') ax.plot([4,4],[2.9, 2.2], color='red', linestyle='dotted', alpha=0.5) ax.text(4.1, 2.6, '-0.7') ax.grid(alpha=0.2) plt.show() Output: Some of the values are negative, summing the errors may lead to them cancelling each other out, so we square the distance, and we sum all the squared distances, # plot the data import matplotlib.pyplot as plt f, ax = plt.subplots(figsize=(5,5)) ax.scatter(df['x'], df['y']) x = np.linspace(0, 4, 5) y = 0*x + 2.2 y_ = 0*df['x'] + 2.2 residuals = (y_ - df['y'])**2 SE = np.sum(residuals) MSE = np.mean(residuals) ax.plot(x,y, label=f'y=2.25') ax.plot([1,1],[1, 2.2], color='red', linestyle='dotted', alpha=0.5) ax.text(1.1, 1.5, '1.44') ax.plot([1.5,1.5],[2.3, 2.2], color='red', linestyle='dotted', alpha=0.5) ax.text(1.6, 2.25, '0.01') ax.plot([2.5,2.5],[2.1, 2.2], color='red', linestyle='dotted', alpha=0.5) ax.text(2.6, 2.12, '0.01') ax.plot([3,3],[3, 2.2], color='red', linestyle='dotted', alpha=0.5) ax.text(3.1, 2.4, '0.64') ax.plot([4,4],[2.9, 2.2], color='red', linestyle='dotted', alpha=0.5) ax.text(4.1, 2.6, '0.49') ax.text(2, 1.5, f'∑={SE}
MSE={MSE}', fontsize=20, color='red') ax.grid(alpha=0.2) plt.show() Output: MSE=1m∑i=1m(yi−yi^)2MSE =  rac{1}{m}\sum_{i=1}^{m}(y_{i} - \hat{y_{i}})^{2}MSE=m1​∑i=1m​(yi​−yi​^​)2 We call this the loss function, or the cost function. and we want to minimize this function. Rinse and Repeat until we get the best line. # plot the data import matplotlib.pyplot as plt f, ax = plt.subplots(figsize=(5,5)) ax.scatter(df['x'], df['y']) x = np.linspace(0, 4, 5) y = x + 0.5 y_ = df['x'] + 0.5 residuals = (y_ - df['y'])**2 SE = np.sum(residuals) MSE = np.mean(residuals) ax.plot(x,y, label=f'y=0.5 + x') ax.plot([1,1],[1, 1.5], color='red', linestyle='dotted', alpha=0.5) ax.text(1.1, 1.5, '0.25') ax.plot([1.5,1.5],[2.3, 2], color='red', linestyle='dotted', alpha=0.5) ax.text(1.6, 2.25, '0.09') ax.plot([2.5,2.5],[2.1, 3], color='red', linestyle='dotted', alpha=0.5) ax.text(2.6, 2.12, '0.81') ax.plot([3,3],[3, 3.5], color='red', linestyle='dotted', alpha=0.5) ax.text(3.1, 2.4, '0.25') ax.plot([4,4],[2.9, 4.5], color='red', linestyle='dotted', alpha=0.5) ax.text(4.1, 2.6, '2.56') ax.text(1.5, .5, f'∑={SE}
